sys_variable_value.value:
(function execute(inputs, outputs) {

var date=new GlideDate().getByFormat("dd-MM-yyyy");
var monthNames = ['JAN', 'FEB', 'MAR', 'APR', 'MAY', 'JUN', 'JUL', 'AUG', 'SEP', 'OCT', 'NOV', 'DEC'];
var monthIndex = new GlideDateTime().getMonthUTC() - 1; // GlideDateTime getMonthUTC() returns 1-12
var month = monthNames[monthIndex];
date=date.split("-");
date[1]=month;
outputs.date =date.join("/");


})(inputs, outputs);

