sys_variable_value.value:
(function execute(inputs, outputs) {
    var array = [];
      function iterateQuestionnaire(qArr) {
         //   gs.error("qwert " + JSON.stringify(qArr));
            if (qArr) {
              // gs.error("sdfg " + JSON.stringify(qArr));
                iterateQuestions(qArr);
            }
        }
                function iterateQuestions(questions) {
            questions.forEach(function (question) {
                var obj={};
                obj.code=question.questionID;
                   if (question.subQuestion && question.subQuestion.length > 0) {
            question.subQuestion.forEach(function (subQuestion) {
                var key = "answer" + subQuestion.questionID;
                obj[key] = subQuestion.questionAnswer;
            });
        }
              array.push(obj)
            });
        }
    try {
        if (!inputs.healthDetails.questionaire || !inputs.healthDetails.questionaire.questionaireList) {
        }
        var qArr = inputs.healthDetails.questionaire.questionaireList;
        iterateQuestionnaire(qArr);
      //  gs.error("hiiii " + JSON.stringify(qArr));
            
    

           var jObj=JSON.parse(inputs.req);
    jObj.healthDetails=array;
outputs.res=jObj;

      // gs.info("helok"+JSON.stringify(jObj));

    } catch (error) {
       gs.error("Error: " + error.message);
    }


 
})(inputs, outputs);

